import { TextField } from '@mui/material';



function Login() {
    return (
        <>
            <h1>Login</h1>

            <form>
                <TextField id="username"
                    label="username or email"
                    variant="outlined"
                    fullWidth />

                <TextField id="password"
                    label="paswword"
                    variant="outlined"
                    fullWidth />
            </form>

        </>
    )
}

export default Login;
